import React, { useEffect, useState } from 'react';

const Partners = () => {
  const [partnersData, setPartnersData] = useState([]);

  useEffect(() => {
    const fetchPartnersData = async () => {
      try {
        const response = await fetch('http://cjezdhm.cluster029.hosting.ovh.net/wp-json/wp/v2/Partners');
        const data = await response.json();
        setPartnersData(data);
      } catch (error) {
        console.error('Erreur lors de la récupération des partenaires :', error);
      }
    };

    fetchPartnersData();
  }, []);

  return (
    <div>
      <h2>Partenaires</h2>
      <ul>
        {partnersData.map((partner) => (
          <li key={partner.id}>
            <h3>{partner.acf.partner_name}</h3>
            <img src={partner.acf.partner_logo.url} alt={partner.acf.partner_name} />
            <p>{partner.acf.partner_description}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Partners;
